	子弹属性.子弹种类 = "透明子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 1;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	子弹属性.伤害类型 = "魔法";

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
